function Vision(){
    return(
        <>
        <h3>VISSION</h3>
        <p>To be recognized as a premier technical and management institution promoting extensive education fostering research, innovation and entrepreneurial attitude</p>
        
        </>
        
    )
}

function Mission()
{
    return(
        <>
        <h3>MISSION</h3>
        <p>To empower students with indispensable knowledge through dedicated teaching and collaborative learning. </p>
        </>
    )
}

function About()
{
    return(
        <>
        <h2>ABOUT MITM</h2>
        <p>Maharaja Institute of Technology Mysore was established in the year 2007 by MET® in a serene location surrounded by sprawling landscape a bit offset from the urbane disruption. Institute is initiated and built by a group of reputable people recognized for their eminence in the field of Science and Technology. Institute was born as a casting of its founders’ eminence and rich experience poured into the mould of their values and aspirations. The Institute made its beginning with an intake of 300 seats encompassing five engineering disciplines. As a toddler in technical education, the institute shown a brisk growth to its potential leaving foot marks at numerous miles stones soon just in a decade. Institute owns a stature known for serving the society with quality education and is well accepted by all the stakeholders. To the date, the institute is nurturing an intake of 900 plus offering various programs at undergraduate, postgraduate and research level. The alumnae of this institute have been extensively acknowledged by the society and industry alike.</p>

        </>
    )
}

export {About,Vision,Mission}
